sys_variable_value.value:
(function execute(inputs, outputs) {
var response = inputs.response;
  var j = JSON.parse(response);
  outputs.thingname = j.name;
  outputs.thingurl = j.public_url;
  outputs.thingthumbnail = j.thumbnail;
  outputs.thingfiles = j.files_url;
  outputs.thingdescription = j.description_html;
  outputs.thinginstructions = j.instructions_html;
  if(j.details_parts[1].data)
  {
  outputs.thingrafts = j.details_parts[1].data[0].rafts;
  outputs.thingsupport = j.details_parts[1].data[0].supports;
  outputs.thingresolution = j.details_parts[1].data[0].resolution;
  //outputs.thingfilament = j.details_parts[1].data[0].filament_material;
  }

})(inputs, outputs);

